import React from 'react';
import { AppleMaps } from 'react-apple-mapkitjs'

function Map() {
    let payload = {
        iss:"352J684H6T",
        iat:Date.now() /1000,
        exp:(Date.now() /1000)+15778800,
        origin:"http://localhost:3000"
    };
    return (
        <AppleMaps 
        token={payload}
    />
    )
}

export default Map
